**** NÃO FAZEMOS ENVIO PARA AL E PE ***** EVITE O CANCELAMENTO DE SUA COMPRA****

***** PRODUTO ORIGINAL HP LACRADO ****

*********** NÃO EMITIMOS NOTA FISCAL *************

*** O cartucho de tinta XL oferece alto rendimento pois contém uma quantidade maior de ML do que um cartucho convencional.

Com o Cartucho de Tinta Hp Alta Capacidade 954XL você garante documentos impressos com alta qualidade e maior velocidade. Ele proporciona cores nítidas e com nível profissional. As tintas Hp são resistentes à marca texto e água, manchas e desbotamentos.

Especificações / 954XL – Preto
- Cor(es) do(s) cartucho(s) de impressão: Preto;
- Gota de tinta: 10,5 pl;
- Tipos de tinta compatíveis: Com pigmentos;
- Rendimento por página (preto e branco): ~2.000 páginas


Especificações / 954XL Ciano - L0S62AB
- Cor(es) do(s) cartucho(s) de impressão: Ciano;
- Gota de tinta: 7 pl;
- Tipos de tinta compatíveis: Com pigmentos;
- Rendimento por página (cores): ~1.600 páginas.


Especificações / 954XL Magenta - L0S65AB
- Cor(es) do(s) cartucho(s) de impressão: Magenta;
- Gota de tinta: 7 pl;
- Tipos de tinta compatíveis: Com pigmentos;
- Rendimento por página (cores): ~1.600 páginas.


Especificações / 954XL Amarelo - L0S68AB
- Cor(es) do(s) cartucho(s) de impressão: Amarela;
- Gota de tinta: 7 pl;
- Tipos de tinta compatíveis: Com pigmentos;
- Rendimento por página (cores): ~1.600 páginas.

Impressoras Compatíveis: Impressora Hp OfficeJet Pro 8210 (D9L63A), Impressora multifuncional Hp OfficeJet Pro 8730 (D9L20A), Multifuncional Hp OfficeJet Pro 7740 para grandes formatos (G5J38A), Multifuncional Hp OfficeJet Pro 8710 (D9L18A), Multifuncional Hp OfficeJet Pro 8720 (D9L19A

Garantia do vendedor: 30 dias
